import React from 'react'
import { Route, Routes } from 'react-router-dom'
import Login from './Pages/Login'

export default function RoutesComp() {
  return (
    <>
        <Routes>
            <Route path='/' element={<Login/>}/>
            <Route path="/home" element={<HomePage/>}/>
        </Routes>
    </>
  )
}
